import React, { Component } from 'react';

import Table from './components/Table/Table';


//Columns defines table headings and properties to be placed into the body
let columns = [
  {
    heading: 'Item',
    property: 'name'
  },
  {
    heading: 'Material Fee',
    property: 'age'
  },
  {
    heading: 'Packing Fee',
    property: 'sex'
  },
  {
    heading: 'Unpacking Fee',
    property: 'breed'
  },
]

//Data is the array of objects to be placed into the table
let data = [
  {
    name: 'Sabrina',
    age: '6',
    sex: 'Female',
    breed: 'Staffordshire'
  },
  {
    name: 'Max',
    age: '2',
    sex: 'Male',
    breed: 'Boxer'
  }
]

class App extends Component {

  render() {
    return (
      <>
        <Table
          columns={columns}
          data={data}
          propertyAsKey='name' 
        />
      </>
    );
  }
}
export default App;
